name: Steamed Brown Bread
source: Betty Crocker
categories: [bakery, bread, side-dishes]
notes: |
  Use two 1-lb coffee cans or one 7" tube-center mold.
ingredients: |
  1 cup rye flour
  1 cup corn meal
  1 cup whole wheat flour
  2 teaspoons baking soda
  1 teaspoon salt
  3/4 cup molasses
  2 cups buttermilk
directions: |
  Mix together dry ingredients.
  Stir in liquid ingredients and beat well.
  Fill greased molds 2/3 full.
  Lay waxed paper over the top.
  Steam for 3 hours.

